import React, { Component } from "react";
import "../css/Table.css";

class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      pass: "",
    };

    this.LoginProccess = this.LoginProccess.bind(this);
  }

  render() {
    return (
      <div className="padd0 col-md-12">
        <input
          type="text"
          className="OneDriveInput form-control"
          defaultValue={this.state.name}
        />
        <input
          type="text"
          className="OneDriveInput form-control"
          defaultValue={this.state.pass}
        />

        <span className="btn btn-primary" onClick={() => this.LoginProccess()}>
          Giri≈ü Yap
        </span>
      </div>
    );
  }

  componentDidMount() {}

  componentWillUnmount() {}

  async LoginProccess() {
    const response = await fetch("Articels", {
      method: "POST",
      cache: "no-cache",
      mode: "cors",
      headers: {
        "Content-Type": "application/json",
        "access-control-allow-credentials": false,
        "Access-Control-Allow-Origin": "Articels",
        Authorization: "bearer ",
      },
    });
  }
}

export default Login;
